// ─── FIREBASE HOOK ────────────────────────────────────────────────────────────
function useFirebaseSync(fbUrl, enabled) {
  const [connected, setConnected] = useState(false);
  const [syncedAuction, setSyncedAuction]   = useState(null);
  const [syncedPlayers, setSyncedPlayers]   = useState(null);
  const [syncedTeams,   setSyncedTeams]     = useState(null);
  const esRef = useRef({});

  useEffect(() => {
    if (!enabled || !fbUrl) return;

    const subscribe = (path, setter) => {
      const url = `${fbUrl.replace(/\/$/, '')}/${path}.json`;
      const es = new EventSource(url);
      es.addEventListener("put", (e) => {
        try {
          const d = JSON.parse(e.data);
          if (d.data !== null) setter(d.data);
        } catch {}
      });
      es.addEventListener("patch", (e) => {
        try {
          const d = JSON.parse(e.data);
          setter(prev => prev ? { ...prev, ...d.data } : d.data);
        } catch {}
      });
      es.onerror = () => setConnected(false);
      es.onopen  = () => setConnected(true);
      return es;
    };

    esRef.current.auction = subscribe("auction",  setSyncedAuction);
    esRef.current.teams   = subscribe("teams",    setSyncedTeams);
    esRef.current.players = subscribe("players",  setSyncedPlayers);

    return () => {
      Object.values(esRef.current).forEach(es => es.close());
      setConnected(false);
    };
  }, [fbUrl, enabled]);

  const writeToFB = useCallback(async (path, data) => {
    if (!fbUrl) return;
    try {
      await fetch(`${fbUrl.replace(/\/$/, '')}/${path}.json`, {
        method: "PUT",
        headers: { "Content-Type": "application/json" },
        body: JSON.stringify(data),
      });
    } catch (err) { console.warn("Firebase write error:", err); }
  }, [fbUrl]);

  const patchFB = useCallback(async (path, data) => {
    if (!fbUrl) return;
    try {
      await fetch(`${fbUrl.replace(/\/$/, '')}/${path}.json`, {
        method: "PATCH",
        headers: { "Content-Type": "application/json" },
        body: JSON.stringify(data),
      });
    } catch (err) { console.warn("Firebase patch error:", err); }
  }, [fbUrl]);

  return { connected, syncedAuction, syncedPlayers, syncedTeams, writeToFB, patchFB };
}

