// ─── HELPERS ─────────────────────────────────────────────────────────────────
const fmt = (n) => `₹${n.toLocaleString("en-IN")}`;
function useInterval(cb, delay) {
  const ref = useRef(cb);
  useEffect(() => { ref.current = cb; }, [cb]);
  useEffect(() => {
    if (delay === null) return;
    const id = setInterval(() => ref.current(), delay);
    return () => clearInterval(id);
  }, [delay]);
}

// ─── STARS ───────────────────────────────────────────────────────────────────
function Stars() {
  const stars = useRef(Array.from({length:55}, (_,i) => ({
    id:i, x:Math.random()*100, y:Math.random()*100,
    size:Math.random()*2+0.5, d:Math.random()*4+2, o:Math.random()*0.5+0.2, delay:Math.random()*4,
  }))).current;
  return (
    <div className="stars">
      {stars.map(s => <div key={s.id} className="star" style={{left:`${s.x}%`,top:`${s.y}%`,width:s.size,height:s.size,'--d':`${s.d}s`,'--o':s.o,animationDelay:`${s.delay}s`}} />)}
    </div>
  );
}

function ToastContainer({ toasts }) {
  return (
    <div className="toast-container">
      {toasts.map(t => <div key={t.id} className={`toast ${t.type}`} dangerouslySetInnerHTML={{__html:t.msg}} />)}
    </div>
  );
}

function CountdownTimer({ timeLeft, totalTime=30 }) {
  const pct=timeLeft/totalTime, r=36, circ=2*Math.PI*r, offset=circ*(1-pct);
  const color = pct>0.5?"#FFD700":pct>0.25?"#FFA500":"#FF4444";
  return (
    <div className="timer-circle">
      <svg width="84" height="84" viewBox="0 0 84 84">
        <circle className="timer-bg" cx="42" cy="42" r={r}/>
        <circle className="timer-arc" cx="42" cy="42" r={r} strokeDasharray={circ} strokeDashoffset={offset} stroke={color}/>
      </svg>
      <div className="timer-text"><span>{timeLeft}</span><span className="timer-sub">secs</span></div>
    </div>
  );
}

function SoldOverlay({ player, team, price, onClose }) {
  useEffect(() => { const t=setTimeout(onClose,3000); return ()=>clearTimeout(t); }, []);
  const confetti = Array.from({length:28},(_,i) => ({id:i, x:Math.random()*100, color:["#FFD700","#00FF88","#00E5FF","#FF6B35"][i%4], delay:Math.random()*2, d:Math.random()*3+2}));
  return (
    <div className="sold-overlay" onClick={onClose}>
      {confetti.map(c => <div key={c.id} className="cf" style={{left:`${c.x}%`,top:'-20px',background:c.color,borderRadius:c.id%2?'50%':'2px',animationDuration:`${c.d}s`,animationDelay:`${c.delay}s`}}/>)}
      <div className="sold-card">
        <div className="sold-text">SOLD!</div>
        <div className="sold-player">{player.name}</div>
        <div className="sold-price-big">{fmt(price)}</div>
        <div className="sold-team-name">{team?.icon} {team?.name}</div>
      </div>
    </div>
  );
}

// ─── LOGIN SCREEN ─────────────────────────────────────────────────────────────
function LoginScreen({ onLogin }) {
  const [email, setEmail] = useState("");
  const [pass, setPass] = useState("");
  const [error, setError] = useState("");

  const handleLogin = () => {
    const user = USERS.find(u => u.email===email && u.password===pass);
    if (user) onLogin(user);
    else { setError("Invalid credentials."); setTimeout(()=>setError(""),3000); }
  };

  return (
    <div className="login-screen">
      <div className="login-logo">
        <img src={`data:image/png;base64,${LOGO_B64}`} alt="Herga Friends" />
        <div className="presents-text">Herga Friends Presents</div>
        <div className="league-title">Herga Friends<br/>Premier League</div>
        <div className="league-season">Season 4 • Player Auction</div>
      </div>
      <div className="login-card">
        <h3>🔐 Secure Login</h3>
        {error && <div className="error-msg">⚠️ {error}</div>}
        <div className="form-group">
          <label>Email Address</label>
          <input className="form-input" type="email" placeholder="Enter your email" value={email} onChange={e=>setEmail(e.target.value)} onKeyDown={e=>e.key==="Enter"&&handleLogin()} />
        </div>
        <div className="form-group">
          <label>Password</label>
          <input className="form-input" type="password" placeholder="Enter password" value={pass} onChange={e=>setPass(e.target.value)} onKeyDown={e=>e.key==="Enter"&&handleLogin()} />
        </div>
        <button className="btn-gold" onClick={handleLogin}>Enter Auction House</button>
        <div className="login-hint">
          Contact your team captain or commissioner for login credentials.
        </div>
      </div>
    </div>
  );
}

// ─── AUCTION LIVE SCREEN ──────────────────────────────────────────────────────
function AuctionLiveScreen({ auction, players, teams, currentUser, onBid, isAdmin, onAdminAction }) {
  const [bidFlash, setBidFlash] = useState(false);
  const prevBid = useRef(auction.currentBid);
  const myTeam = teams.find(t => t.id === currentUser.teamId);
  const currentPlayer = players.find(p => p.id === auction.currentPlayerId);
  const leadingTeam   = teams.find(t => t.id === auction.leadingTeamId);
  const soldPlayers   = players.filter(p => p.status === "sold");
  const [timeLeft, setTimeLeft] = useState(30);

  useEffect(() => {
    if (auction.currentBid !== prevBid.current) {
      setBidFlash(true); setTimeout(()=>setBidFlash(false),500);
      prevBid.current = auction.currentBid; setTimeLeft(30);
    }
  }, [auction.currentBid]);
  useInterval(() => { if (auction.auctionStatus==="live") setTimeLeft(t=>Math.max(0,t-1)); }, 1000);
  useEffect(() => { setTimeLeft(30); }, [auction.currentPlayerId]);

  const canBid = currentUser.role==="owner" && auction.auctionStatus==="live" && myTeam &&
    myTeam.purseRemaining >= (auction.currentBid + auction.bidIncrement) &&
    auction.leadingTeamId !== myTeam.id && currentPlayer;

  if (!currentPlayer && auction.auctionStatus !== "live") {
    return (
      <div className="auction-screen">
        <div className="empty-state"><div className="ico">🏏</div>
          <p style={{color:'var(--gold)',fontSize:17,fontFamily:'Rajdhani',fontWeight:700,marginBottom:7}}>Auction Not Started</p>
          <p>Waiting for the Admin to begin...</p>
        </div>
      </div>
    );
  }
  const roleColor = currentPlayer ? ROLE_COLORS[currentPlayer.role] : "#FFD700";
  const pursePercent = myTeam ? (myTeam.purseRemaining/myTeam.purseTotal)*100 : 0;

  return (
    <div className="auction-screen">
      <div style={{display:'flex',alignItems:'center',justifyContent:'space-between'}}>
        <span className={`status-badge status-${auction.auctionStatus==='live'?'live':auction.auctionStatus==='paused'?'paused':'stopped'}`}>
          {auction.auctionStatus==='live'?'Live':auction.auctionStatus==='paused'?'Paused':'Stopped'}
        </span>
        {auction.auctionStatus==='live' && <CountdownTimer timeLeft={timeLeft}/>}
      </div>

      {currentPlayer && (
        <div className="player-card-main" key={currentPlayer.id}>
          <div className="big-avatar" style={{background:`linear-gradient(135deg,${roleColor},${roleColor}88)`}}>{currentPlayer.avatar}</div>
          <div className="player-name-big">{currentPlayer.name}</div>
          <div className="role-tag-big" style={{background:`${roleColor}22`,color:roleColor,border:`1px solid ${roleColor}44`}}>{currentPlayer.role}</div>
          <div className="base-price">Base Price: <span>{fmt(currentPlayer.basePrice)}</span></div>
        </div>
      )}

      <div className="bid-section">
        <div className="bid-label">Current Bid</div>
        <div className={`bid-amount ${bidFlash?'flash':''}`} key={auction.currentBid}>{fmt(auction.currentBid)}</div>
        {leadingTeam && (
          <div className="leading-team">
            <span className="icon">{leadingTeam.icon}</span>
            <span className="name" style={{color:leadingTeam.color}}>{leadingTeam.name}</span>
            <span className="crown">👑</span>
          </div>
        )}
      </div>

      <div style={{textAlign:'center',fontSize:10,color:'var(--text2)',letterSpacing:2}}>
        BID INCREMENT: <span style={{color:'var(--gold)',fontWeight:700}}>{fmt(auction.bidIncrement)}</span>
      </div>

      {currentUser.role==="owner" && (
        <div className="bid-controls">
          <button className="btn-bid" disabled={!canBid} onClick={()=>{ if(canBid) onBid(auction.currentBid+auction.bidIncrement, myTeam.id); }}>
            {!canBid&&auction.leadingTeamId===myTeam?.id ? "🏆 You're Leading!" : canBid ? `🏏 Place Bid — ${fmt(auction.currentBid+auction.bidIncrement)}` : "❌ Cannot Bid"}
          </button>
          {myTeam && (
            <div className="card" style={{padding:12}}>
              <div className="purse-meter">
                <div className="purse-info"><span>Your Purse</span><span>{fmt(myTeam.purseRemaining)}</span></div>
                <div className="purse-bar-wrap">
                  <div className="purse-bar" style={{width:`${pursePercent}%`,background:`linear-gradient(90deg,${pursePercent<25?'#FF4444':'#00FF88'},${pursePercent<25?'#FF8888':'#FFD700'})`}}/>
                </div>
              </div>
            </div>
          )}
        </div>
      )}

      {isAdmin && (
        <div className="card card-gold">
          <div className="sec-title" style={{marginBottom:10}}>⚡ Admin Controls</div>
          <div className="control-grid">
            <button className="btn-control btn-approve" onClick={()=>onAdminAction('approveBid')}>✅ Approve</button>
            <button className="btn-control btn-pause" onClick={()=>onAdminAction(auction.auctionStatus==='paused'?'resume':'pause')}>
              {auction.auctionStatus==='paused'?'▶ Resume':'⏸ Pause'}
            </button>
            <button className="btn-control btn-sold" onClick={()=>onAdminAction('sold')}>🏆 Mark SOLD</button>
            <button className="btn-control btn-unsold" onClick={()=>onAdminAction('unsold')}>❌ Mark UNSOLD</button>
          </div>
        </div>
      )}

      <div className="card">
        <div className="sec-header"><div className="sec-title">Teams Purse</div></div>
        <table className="teams-table">
          <thead><tr><th>Team</th><th>Remaining</th><th>Players</th></tr></thead>
          <tbody>
            {teams.map(t => (
              <tr key={t.id} className={t.id===auction.leadingTeamId?'leading':''}>
                <td><div className="team-name-cell"><div className="team-dot" style={{background:t.color}}/>{t.icon} {t.shortName}</div></td>
                <td style={{color:'var(--gold)',fontFamily:'Rajdhani',fontWeight:700}}>{fmt(t.purseRemaining)}</td>
                <td style={{color:'var(--text2)',textAlign:'right'}}>{t.players.length}</td>
              </tr>
            ))}
          </tbody>
        </table>
      </div>

      {soldPlayers.length > 0 && (
        <div className="card">
          <div className="sec-header"><div className="sec-title">Sold Players</div></div>
          <div className="sold-scroll">
            {soldPlayers.map(p => {
              const team = teams.find(t=>t.id===p.soldTo);
              return (
                <div key={p.id} className="sold-chip">
                  <div className="sc-name">{p.name}</div>
                  <div className="sc-price">{fmt(p.soldPrice)}</div>
                  <div className="sc-team">{team?.icon} {team?.shortName}</div>
                </div>
              );
            })}
          </div>
        </div>
      )}
    </div>
  );
}

