// ─── MAIN APP ─────────────────────────────────────────────────────────────────
export default function App() {
  const [currentUser, setCurrentUser] = useState(null);
  const [activeTab,   setActiveTab]   = useState("live");
  const [players,     setPlayers]     = useState(INITIAL_PLAYERS);
  const [teams,       setTeams]       = useState(INITIAL_TEAMS);
  const [auction,     setAuction]     = useState({
    currentPlayerId:null, currentBid:0, leadingTeamId:null,
    auctionStatus:"stopped", bidIncrement:1000,
  });
  const [toasts,      setToasts]      = useState([]);
  const [soldOverlay, setSoldOverlay] = useState(null);
  const [fbUrl,       setFbUrl]       = useState("");

  const { connected, syncedAuction, syncedPlayers, syncedTeams, writeToFB, patchFB } =
    useFirebaseSync(fbUrl, !!fbUrl);

  // Apply Firebase updates to local state
  useEffect(() => { if (syncedAuction) setAuction(syncedAuction); }, [syncedAuction]);
  useEffect(() => { if (syncedTeams)   setTeams(Array.isArray(syncedTeams) ? syncedTeams : Object.values(syncedTeams)); }, [syncedTeams]);
  useEffect(() => { if (syncedPlayers) setPlayers(Array.isArray(syncedPlayers) ? syncedPlayers : Object.values(syncedPlayers)); }, [syncedPlayers]);

  const addToast = useCallback((msg,type="info") => {
    const id = Date.now();
    setToasts(t=>[...t,{id,msg,type}]);
    setTimeout(()=>setToasts(t=>t.filter(x=>x.id!==id)),3000);
  }, []);

  const handleLogin  = (user) => { setCurrentUser(user); setActiveTab("live"); };
  const handleLogout = () => { setCurrentUser(null); setActiveTab("live"); };

  const handleBid = (amount, teamId) => {
    const newAuction = {...auction, currentBid:amount, leadingTeamId:teamId};
    setAuction(newAuction);
    if (fbUrl) writeToFB("auction", newAuction);
    const team = teams.find(t=>t.id===teamId);
    addToast(`<strong>${team?.name}</strong> bid ${fmt(amount)}!`, "success");
  };

  const handleAdminAction = (action, value) => {
    let newAuction = auction;
    let newPlayers = players;
    let newTeams   = teams;

    switch (action) {
      case 'start':
        if (!auction.currentPlayerId) { addToast("Select a player first!","warning"); return; }
        newAuction = {...auction, auctionStatus:'live'};
        const sp = players.find(x=>x.id===auction.currentPlayerId);
        if (sp) newAuction.currentBid = sp.basePrice;
        newAuction.leadingTeamId = null;
        newPlayers = players.map(p=>p.id===auction.currentPlayerId?{...p,status:'live'}:p);
        addToast("🚀 Auction started!","success"); break;
      case 'pause':
        newAuction = {...auction,auctionStatus:'paused'};
        addToast("⏸ Auction paused","warning"); break;
      case 'resume':
        newAuction = {...auction,auctionStatus:'live'};
        addToast("▶ Auction resumed","success"); break;
      case 'stop':
        newAuction = {...auction,auctionStatus:'stopped'};
        addToast("⏹ Auction stopped","warning"); break;
      case 'setPlayer':
        const pp = players.find(x=>x.id===value);
        newAuction = {...auction,currentPlayerId:value,currentBid:pp?pp.basePrice:0,leadingTeamId:null};
        break;
      case 'setIncrement':
        newAuction = {...auction,bidIncrement:value};
        addToast(`Increment set to ${fmt(value)}`,"info"); break;
      case 'approveBid':
        addToast(`✅ Bid approved!`,"success"); break;
      case 'sold': {
        const p  = players.find(x=>x.id===auction.currentPlayerId);
        const t  = teams.find(x=>x.id===auction.leadingTeamId);
        if (!p||!t) { addToast("No active bid!","warning"); return; }
        newPlayers = players.map(x=>x.id===p.id?{...x,status:'sold',soldTo:t.id,soldPrice:auction.currentBid}:x);
        newTeams   = teams.map(x=>x.id===t.id?{...x,purseRemaining:x.purseRemaining-auction.currentBid,players:[...x.players,p.id]}:x);
        newAuction = {...auction,currentPlayerId:null,currentBid:0,leadingTeamId:null,auctionStatus:'stopped'};
        setSoldOverlay({player:p,team:t,price:auction.currentBid});
        break;
      }
      case 'unsold': {
        const p2 = players.find(x=>x.id===auction.currentPlayerId);
        if (!p2) return;
        newPlayers = players.map(x=>x.id===p2.id?{...x,status:'unsold'}:x);
        newAuction = {...auction,currentPlayerId:null,currentBid:0,leadingTeamId:null,auctionStatus:'stopped'};
        addToast(`❌ ${p2.name} went unsold`,"warning"); break;
      }
    }

    setAuction(newAuction); setPlayers(newPlayers); setTeams(newTeams);
    if (fbUrl) {
      writeToFB("auction",  newAuction);
      writeToFB("players",  newPlayers);
      writeToFB("teams",    newTeams);
    }
  };

  const handleAddPlayer = (data) => {
    const p={id:`p${Date.now()}`,...data,status:'upcoming',soldTo:null,soldPrice:null,avatar:data.name[0].toUpperCase()};
    const newPlayers=[...players,p];
    setPlayers(newPlayers);
    if (fbUrl) writeToFB("players",newPlayers);
    addToast(`✅ ${p.name} added!`,"success");
  };
  const handleDeletePlayer = (id) => {
    const newPlayers=players.filter(p=>p.id!==id);
    setPlayers(newPlayers);
    if (fbUrl) writeToFB("players",newPlayers);
    addToast("Player deleted","warning");
  };
  const handleEditPlayer = (updated) => {
    const newPlayers=players.map(p=>p.id===updated.id?updated:p);
    setPlayers(newPlayers);
    if (fbUrl) writeToFB("players",newPlayers);
    addToast("✅ Player updated!","success");
  };
  const handleEditPurse = (teamId, amount) => {
    const newTeams=teams.map(t=>t.id===teamId?{...t,purseTotal:amount,purseRemaining:amount}:t);
    setTeams(newTeams);
    if (fbUrl) writeToFB("teams",newTeams);
    addToast("Purse updated!","success");
  };
  const handleEditTeamName = (teamId, newName) => {
    const shortName = newName.split(' ').map(w=>w[0]).join('').toUpperCase().slice(0,3);
    const newTeams  = teams.map(t=>t.id===teamId?{...t,name:newName,shortName}:t);
    setTeams(newTeams);
    if (fbUrl) writeToFB("teams",newTeams);
    addToast(`Team renamed to "${newName}"!`,"success");
  };

  const isAdmin = currentUser?.role==="admin";
  const adminTabs  = [{id:'dashboard',label:'📊 Dashboard'},{id:'live',label:'🔴 Live'},{id:'control',label:'🎛 Control'},{id:'players',label:'🏏 Players'},{id:'teams',label:'👥 Teams'}];
  const ownerTabs  = [{id:'live',label:'🔴 Live Auction'},{id:'teams',label:'📋 My Team'}];
  const viewerTabs = [{id:'live',label:'👁 Watch Live'},{id:'teams',label:'📋 Teams'}];
  const tabs = isAdmin ? adminTabs : currentUser?.role==='owner' ? ownerTabs : viewerTabs;

  if (!currentUser) return (
    <div className="app">
      <style>{css}</style>
      <Stars/>
      <LoginScreen onLogin={handleLogin}/>
    </div>
  );

  return (
    <div className="app">
      <style>{css}</style>
      <Stars/>
      <ToastContainer toasts={toasts}/>
      {soldOverlay && <SoldOverlay player={soldOverlay.player} team={soldOverlay.team} price={soldOverlay.price} onClose={()=>setSoldOverlay(null)}/>}
      <div className="main-layout">
        <div className="topbar">
          <div className="topbar-brand">
            <img className="topbar-logo" src={`data:image/png;base64,${LOGO_B64}`} alt="HFPL"/>
            <div>
              <div className="name">HFPL</div>
              <span className="season">Season 4</span>
            </div>
          </div>
          <div className="topbar-right">
            <span style={{fontSize:11,color:'var(--text2)'}}>{currentUser.name}</span>
            <span className={`role-badge role-${currentUser.role}`}>{currentUser.role}</span>
            <button className="btn-sm" onClick={handleLogout}>Exit</button>
          </div>
        </div>
        <FirebaseBar connected={connected} fbUrl={fbUrl} onSetUrl={(url)=>{setFbUrl(url); if(!url){addToast("Firebase disconnected","warning")} else {addToast("Connecting to Firebase...","info")}}} />
        <div className="nav-tabs">
          {tabs.map(t=>(
            <button key={t.id} className={`nav-tab ${activeTab===t.id?'active':''}`} onClick={()=>setActiveTab(t.id)}>{t.label}</button>
          ))}
        </div>
        <div className="content">
          {activeTab==='dashboard' && isAdmin && (
            <AdminDashboard auction={auction} players={players} teams={teams} onQuickStart={()=>{setActiveTab('control');addToast("Select a player and start!","info");}}/>
          )}
          {activeTab==='live' && (
            <AuctionLiveScreen auction={auction} players={players} teams={teams} currentUser={currentUser} onBid={handleBid} isAdmin={isAdmin} onAdminAction={handleAdminAction}/>
          )}
          {activeTab==='control' && isAdmin && (
            <AdminControlPanel auction={auction} players={players} teams={teams} onAction={handleAdminAction}/>
          )}
          {activeTab==='players' && isAdmin && (
            <PlayerManagement players={players} onAdd={handleAddPlayer} onDelete={handleDeletePlayer} onEdit={handleEditPlayer}/>
          )}
          {activeTab==='teams' && (
            <TeamManagement teams={teams} players={players} onEditPurse={isAdmin?handleEditPurse:()=>{}} onEditTeamName={isAdmin?handleEditTeamName:()=>{}} isAdmin={isAdmin} currentUserTeamId={currentUser.teamId}/>
          )}
        </div>
      </div>
    </div>
  );
}
